const nd=new Date;function dateFormat(){var e=nd.getMilliseconds();return`${nd.getFullYear()}-${10>nd.getMonth()?"0"+(nd.getMonth()+1):nd.getMonth()}-${10>nd.getDate()?"0"+nd.getDate():nd.getDate()} ${10>nd.getHours()?"0"+nd.getHours():nd.getHours()}:${10>nd.getMinutes()?"0"+nd.getMinutes():nd.getMinutes()}:${10>nd.getSeconds()?"0"+nd.getSeconds():nd.getSeconds()}.${(()=>{switch(String(e).length){case 1:return`00${e}`;case 2:return`0${e}`;case 3:return`${e}`}})()}`}function level(e){switch(e){case"trace":return`\x1b[30;47mTRACE\x1b[0m`;case"debug":return`\x1b[34mDEBUG\x1b[0m`;case"info":return`\x1b[32mINFO \x1b[0m`;case"warn":return`\x1b[33mWARN \x1b[0m`;case"error":return`\x1b[31mERROR\x1b[0m`;case"fatal":return`\x1b[31mFATAL\x1b[0m`}}const sout4js={trace(e){console.log(`${dateFormat()} ${level("trace")} - ${e}`)},debug(e){console.log(`${dateFormat()} ${level("debug")} - ${e}`)},info(e){console.log(`${dateFormat()} ${level("info")} - ${e}`)},warn(e){console.log(`${dateFormat()} ${level("warn")} - ${e}`)},error(e){console.log(`${dateFormat()} ${level("error")} - ${e}`)},fatal(e){console.log(`${dateFormat()} ${level("fatal")} - ${e}`)},traceAdv(e,t,r,a=!0){(a?console.trace:console.log)(`${dateFormat()} [${t}] ${level("trace")} ${r} - ${e}`)},debugAdv(e,t,r,a=!0){(a?console.debug:console.log)(`${dateFormat()} [${t}] ${level("debug")} ${r} - ${e}`)},infoAdv(e,t,r,a=!0){(a?console.info:console.log)(`${dateFormat()} [${t}] ${level("info")} ${r} - ${e}`)},warnAdv(e,t,r,a=!0){(a?console.warn:console.log)(`${dateFormat()} [${t}] ${level("warn")} ${r} - ${e}`)},errorAdv(e,t,r,a=!0){(a?console.error:console.log)(`${dateFormat()} [${t}] ${level("error")} ${r} - ${e}`)},fatalAdv(e,t,r,a=!0){(a?console.error:console.log)(`${dateFormat()} [${t}] ${level("fatal")} ${r} - ${e}`)}};